<div class=" highlight hl-ipython3"><pre><span></span><span class="c1"># Matplotlib is a well-established data visualizaation library that is well supported</span>
<span class="c1"># in different environments such as python script, Ipython shell and jupyter notebook</span>
<span class="c1"># jupyter notebokok is the open source web application that allows you to create and share</span>
<span class="c1"># Matplotlib has a number of different backend available. </span>
<span class="c1"># one of the limitation of backend is that you cannot modify a figure once its rendered.</span>
<span class="c1"># means that after rendering one figure, there is no way to add , for example</span>
<span class="c1"># a figure title or label axes. You will need to generate a new plot and add the title and the label</span>
<span class="c1"># one backend that overcomes this limitation is the notebook backend</span>
<span class="c1">#w with notebook backend implemented, if a plt function is called, </span>
<span class="c1"># it checks if an active figure exist, and any function you call will be applied</span>
<span class="c1"># to this active figure. if a figure did not exist, it renders a new figure.</span>
