<div class=" highlight hl-ipython3"><pre><span></span><span class="c1">#Box Plot Visualization Notes</span>
<span class="c1">#-------------------------------</span>
<span class="c1"># A Box plot is a way of statistically representing the distribution of a given data through 5 dimension</span>
<span class="c1"># 1. Minimum 2. First Quartile 3. Median 4. Third Quartile 5. Maximum</span>

<span class="c1"># The minimum value is the smallest number in the sorted data</span>
<span class="c1"># The first Quartile is 25% of the way through the sorted data. in the other word, 1/4 of the data points are less than this value</span>
<span class="c1"># The median which is the mid value of the sorted Data</span>
<span class="c1"># The third Quartile is the 75% of the way through the sorted data. Meaning 3/4 of the data points are less than this value</span>
<span class="c1"># The maximum, the highest number in the sorted data </span>
<span class="c1"># boxplot also display outliers as individual dots that occur outside the upper and lower extreme</span>
</pre></div>

