<div class=" highlight hl-ipython3"><pre><span></span><span class="c1">#Scatter Plot Visualization Notes</span>
<span class="c1">#--------------------------------</span>

<span class="c1">#A Scatter plot is a type of plot that displays values pertaining to typically two variables against each other.</span>
<span class="c1"># Usually it is a dependent variable to be plotted against and independent variable in order to </span>
<span class="c1"># determine if any correlation between the two variables exists</span>
</pre></div>

